class MyHabilities extends React.Component {
    render () {
        return (
            <div>
                <h1>Me chamo Cassio</h1>
                <h2>Minhas Habilidades</h2>
                <ul>
                    <li>Comer</li>
                    <li>Dormir</li>
                    <li>Cagar</li>
                    <li>Jogar</li>
                    <li>Fazer absolutamente nada</li>
                </ul>
            </div>
        );
    }
}

export default MyHabilities
